function Home() {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-blue-600">การเรียนรู้ภาษามือไทยเบื้องต้น</h1>
      <p className="mt-4 text-gray-700">
        ภาษามือใช้ท่าทางมือ นิ้วมือ การเคลื่อนไหว สีหน้า และท่าทางร่างกาย 
        ในการสื่อสาร เหมาะสำหรับผู้ที่ต้องการเรียนรู้เพื่อการสื่อสารและการทำงาน
      </p>
      <button className="mt-6 px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700">
        Start Learning Now
      </button>
    </div>
  );
}

export default Home;
